DROP TABLE IF EXISTS `parkslot`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `parkslot` (
  `ParkSlotId` char(36) NOT NULL DEFAULT '',
  `Vehicle` int NOT NULL DEFAULT '0' COMMENT '0 là xe đạp, 1 là xe máy, 2 là ô tô',
  `LicensePlate` varchar(20) DEFAULT NULL COMMENT 'Biển số của xe đang gửi tại vị trí này',
  `VehicleInDate` datetime DEFAULT NULL COMMENT 'Thời gian xe vào',
  `CreatedDate` datetime DEFAULT NULL,
  `CreatedBy` varchar(255) DEFAULT NULL,
  `ModifiedDate` datetime DEFAULT NULL,
  `ModifiedBy` varchar(255) DEFAULT NULL,
  `CompanyId` char(36) DEFAULT NULL,
  `ParkingId` char(36) DEFAULT NULL,
  `ParkSlotState` int DEFAULT NULL,
  `ParkMemberCode` varchar(255) DEFAULT NULL,
  `ParkSlotCode` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`ParkSlotId`),
  KEY `FK_parkslot_ParkingId` (`ParkingId`),
  CONSTRAINT `FK_parkslot_ParkingId` FOREIGN KEY (`ParkingId`) REFERENCES `parking` (`ParkingId`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci AVG_ROW_LENGTH=137;
