CREATE  PROCEDURE `Proc_Read_AccountsFilter`(IN p_Page int, IN p_PageSize int, IN p_SearchProperty varchar(255), IN p_CompanyId char(36))
BEGIN

  DECLARE firstIndex int DEFAULT p_Page  * p_PageSize;

  DECLARE searchString varchar(255) DEFAULT NULL;

    IF p_SearchProperty IS NULL THEN

        SELECT * FROM account a WHERE a.CompanyId = p_CompanyId LIMIT firstIndex, p_pageSize;

    ELSE

        SET searchString = CONCAT('%', p_SearchProperty, '%');  -- Sử dụng CONCAT để nối chuỗi

        SELECT * FROM department d 

        WHERE 

			(DepartmentId = p_SearchProperty OR

			DepartmentName LIKE searchString )

      AND d.CompanyId = p_CompanyId

		LIMIT firstIndex, p_PageSize;

    END IF;

END ;;
