CREATE  PROCEDURE `Proc_Read_ParkingHistorysFilter`(IN p_Page int, IN p_PageSize int, IN p_SearchProperty varchar(255), IN p_CompanyId char(36))
BEGIN

  DECLARE searchString varchar(255) DEFAULT NULL;

  DECLARE vehicleSearch int DEFAULT -1;

  DECLARE firstIndex int DEFAULT p_Page  * p_PageSize;

  CASE

  when p_SearchProperty IS NULL THEN

    SELECT

      *

    FROM view_read_parkinghistory vrp

    WHERE vrp.CompanyId = p_CompanyId LIMIT firstIndex, p_PageSize;

  WHEN p_SearchProperty REGEXP '^[0-2]$' THEN

    BEGIN

    set vehicleSearch = CAST(p_SearchProperty AS UNSIGNED);

    SELECT * from view_read_parkinghistory vrp

      WHERE vrp.CompanyId = p_CompanyId AND vrp.Vehicle = vehicleSearch LIMIT firstIndex, p_PageSize ;

    END;

  ELSE

  BEGIN

    SET searchString = CONCAT('%', p_SearchProperty, '%');  -- Sử dụng CONCAT để nối chuỗi

    SELECT * FROM (SELECT

      *, CAST(vrp.Vehicle AS char) AS VehicleSearch, CAST(vrp.VehicleOutDate as char) AS VehicleOutDateSearch, 

      CAST(VehicleIndate AS char) as VehicleInDateSearch

    FROM view_read_parkinghistory vrp

    WHERE vrp.CompanyId = p_CompanyId ) as ph

    where (

    ph.ParkingHistoryId = p_SearchProperty

    OR VehicleSearch = p_SearchProperty

    OR VehicleOutDateSearch LIKE p_SearchProperty

    OR ph.VehicleInDate LIKE p_SearchProperty

    )LIMIT firstIndex, p_PageSize;



  END;

  END CASE;

END ;;
