    OR p.LicensePlate = p_SearchProperty

      OR p.ParkingId = p_SearchProperty

      OR p.ParkSlotId = p_SearchProperty

      OR p.ParkSlotState = p_SearchProperty

    ) ORDER BY p.ParkSlotCode LIMIT firstIndex, p_PageSize;



  END;

  END CASE;

